INSERT INTO `issue_tracker` (`id`, `username`, `issue_type`, `priority`, `issue_descp`, `response`, `status`, `created_on`) VALUES
(1, '002815', 'Tab ', 'High', 'Tab is having conflict prpblem. If we click to My Account and then just go over the My Appraisal it remains in My Appraisal but the page shows My Account details.', 'no issues found', 'Completed', '2011-03-24 14:54:38'),
(7, '000127', 'Alert Mail', 'High', 'Hi,\r\n\r\nMy reportees submitted their appraisal, but I have not received any mail alert for the same. Not sure, this is because of my mail id which is production@laserwords.com and not with my name. Please let me know whether I can proceed without any mail alert.\r\n\r\nThanks\r\nGomathy', 'closed', 'Completed', '2011-03-30 13:47:47'),
(6, '003359', '-176%', 'High', 'I cant save the values It showing -176%', 'fixed', 'Completed', '2011-03-29 16:02:45'),
(3, '000406', 'intimation mail', 'Emergency', 'I am not getting  intimation mail, once my team members submit the form. ', 'fixed', 'Completed', '2011-03-25 11:58:29'),
(4, '001793', 'Viewing Description', 'High', 'Not able to view the description for the evaluation criteria fully.', 'Please be clear so that we can check it outthanks-------------posted:Not able to view the description for the evaluation criteria fully.', 'In Hold', '2011-03-26 22:07:02'),
(5, '002332', 'Requirement of Scroll Bar', 'Low', 'Overall it is so nice for fonts, color and appearance.\r\n\r\nPlease provide the scroll bar in the Description box of Professional Experience Info.', 'Done!.Thanks', 'Completed', '2011-03-28 16:46:52'),
(8, '002332', 'Not showing the list', 'High', 'I am unable to view the below employee details in My Reportees.\r\n\r\nEmp ID: 002927\r\nName: Mohan Kumar\r\n\r\nPlease note before 2.00 PM it was showing in the list.\r\n', 'HR Team will look in to your issue and update you in this regardsthanks', 'Completed', '2011-04-05 16:44:44'),
(9, '000188', 'Designation', 'High', 'Please change him Designation in Executive.', 'Designation Changed', 'Completed', '2011-04-07 11:59:06'),
(10, '001512', 'CL Appraisal', 'Urgent', 'Unable to save or submit the contents', '', 'Open', '2011-04-12 10:42:40'),
(11, '000375', 'mouse over', 'Urgent', 'can the display on mouse over stay on when mouse is not moved. Can the window be made larger to show all rating parameters.', '', 'Open', '2011-04-16 12:29:24'),
(12, '000375', 'stop revet to home page all the time', 'High', 'Instead can it go back to the last viewed page.\r\n\r\nEg. If I write a comment on customer orientation and press submit the page returns to first page instead it should return to customer orientation page from where I went to the remarks page. This helps to continue where I left off.', '', 'Open', '2011-04-16 12:32:52');
