(292, 1223, 1217, 1, 1, '', '', 75, 50, 50, 'He is able to deliver the assigned work and never has done beyond the expectation', '2011-03-24', '2011-03-29', '0000-00-00'),
(293, 1223, 1217, 1, 13, '', '', 100, 75, 50, '1. Consider accuracy, thoroughness, effectiveness.\n2. Pressure, ability to meet standards of quality.\n3. Use of time and volume of work accomplished.\n4. Work output matches the expectations established.\n\nAll these above mentioned points need to be there to produce quality work in his career\n\n', '2011-03-24', '2011-03-29', '0000-00-00'),
(294, 1223, 1217, 2, 2, '', '', 100, 75, 12.5, 'Attendance and punctuality is one of the simplest things to rate an employee on if you have accurate time keeping records.\n\nBased on the above points mentioned here, I have never seen you very punctual on time.\n\nI have often seen his attitude towards, just to complete 8:30 hours. \n\nI am expecting from him to spend quality time in office, not to complete 8:30 minutes. It is meaningless.', '2011-03-24', '2011-03-29', '0000-00-00'),
(295, 1223, 1217, 2, 3, '', '', 100, 75, 12.5, 'Employee attitudes are crucial for an organization, since they usually lead to desired behaviors. I have often seen your attitude towards fellow employees are well.', '2011-03-24', '2011-03-29', '0000-00-00'),
(296, 1223, 1217, 2, 4, '', '', 100, 75, 25, '1. Ready to hear superior''s ideas and thoughts\n ', '2011-03-24', '2011-03-29', '0000-00-00'),
(297, 1223, 1217, 2, 5, '', '', 75, 50, 25, '1. Demonstrates oral and/or written communications skills that result in very clear and concise messages and feedback. \n2. Very rarely is it necessary to ask employee to explain unclear or ambiguous communications.  \n3. Exhibits the ability to explain or describe in a manner that is easily understood by most recipients.\n\nHis communication skills are well, but I would not say he is having exceptional skills. ', '2011-03-24', '2011-03-29', '0000-00-00'),
(298, 1223, 1217, 2, 8, '', '', 100, 75, 12.5, 'Always willing to listen to multiple perspectives. Actively seeks input from relevant sources when making decisions and openly encourages a diversity of opinions. Possesses a variety of strategies for solving problems, performing job duties, interacting with others, etc. Consistently alters behavior to effectively respond to situational demands. Constantly solicits feedback from others regarding their performance. Uses performance feedback to effectively alter and improve subsequent performance. Views new challenges as opportunities for improvement and embraces change enthusiastically.\n\n', '2011-03-24', '2011-03-29', '0000-00-00'),
(299, 1223, 1217, 2, 9, '', '', 75, 75, 12.5, '', '2011-03-24', '2011-03-29', '0000-00-00'),
(300, 1223, 1217, 3, 16, '', '', 100, 75, 50, 'Consider the extent to which the employee sets own constructive work practice and recommends and creates own procedures.\nSelf-starter, develop and implement new methods, procedures, solutions, concepts, designs and/or applications of existing designs or procedures.\nAccepts additional challenges and responsibilities and willingly assist others, self-reliant.\nCompletes assignment on time.\n\nI am expecting, he has to be self starter and self motivated and taking additional responsibilities towards work. But he is   meeting the expectations as of now. \n', '2011-03-24', '2011-03-29', '0000-00-00'),
(301, 1223, 1217, 3, 20, '', '', 100, 75, 50, 'Adapting to changes and using resources effectively;\nMaintains confidentiality as appropriate.\nSetting objectives, establishing priorities, developing plans ;\nArranging work schedules and prioritizing work to meet deadlines.\nKnow when to ask for clarification before proceeding on a work project.\n\nCurrently his planning looks ok, but he has to plan well to meet the client requirements on time', '2011-03-24', '2011-03-29', '0000-00-00'),
(302, 1223, 1217, 4, 24, '', '', 100, 75, 20, 'He is good as a subject matter expert on \nePublishing.\nConsistently ensures that work is peer reviewed prior to sharing with manager.  \nFeedback reflecting negatively on the employees quality of service is extremely rare.', '2011-03-24', '2011-03-29', '0000-00-00'),
(303, 1223, 1217, 4, 26, '', '', 100, 50, 40, 'Initiative refers to the identification of a problem, obstacle or opportunity and taking action in light of this identification to address the current or future problems or opportunities.  Initiative should be seen in the context of proactively doing things and not simply thinking about future actions.  The time frame of this scale moves from addressing current situations to acting on future opportunities or problems.', '2011-03-24', '2011-03-29', '0000-00-00'),
(304, 1223, 1217, 4, 27, '', '', 75, 75, 20, '', '2011-03-24', '2011-03-29', '0000-00-00'),
(305, 1223, 1217, 4, 28, '', '', 100, 100, 20, '', '2011-03-24', '2011-03-29', '0000-00-00'),
(306, 1224, 1217, 1, 1, '', '', 75, 100, 50, '1. He delivered IPF application for ZB\n2. He has given good amount of demos\n3. He has taken ownership of many of the deliverable\n4. He has taken care of production support\n5. He has given enough training to the tech support team to manage the issues\n \n', '2011-03-24', '2011-03-30', '0000-00-00'),
(307, 1224, 1217, 1, 13, '', '', 100, 75, 50, 'He has delivered IPF applications well based on his knowledge. In fact he has done demo well, I would accept his quality of work is exceeds expectations, but never reached outstanding level. He has to concentrate on high standard quality output.', '2011-03-24', '2011-03-30', '0000-00-00'),
(308, 1224, 1217, 2, 2, '', '', 75, 100, 12.5, 'He is very prompt to office', '2011-03-24', '2011-03-30', '0000-00-00'),
