(797, 1219, 1217, 1, 12, '', '', 75, 50, 33.3, 'Displays creativity in seeking solutions to problems and in making decisions.  Is able to integrate new ideas with current approaches.  Effectively identifies potential problems before they arise and acts on problems in the early stages.  Once solved, problems do not arise again and solutions do not create new problems.  Makes good decisions with limited but accurate information while working within schedule.\n\nI am expecting these kinds of information from you to produce best result towards work. \n\nHe needs to concentrate more towards these areas', '2011-03-25', '2011-03-30', '0000-00-00'),
(798, 1219, 1217, 1, 13, '', '', 100, 50, 33.4, '1. Consider accuracy, thoroughness, effectiveness.\n2. Pressure, ability to meet standards of quality.\n3. Use of time and volume of work accomplished.\n4. Work output matches the expectations established.\n\nAll these above mentioned points need to be there in your career to produce quality work. But I could see, he needs to increase all the above mentioned points', '2011-03-25', '2011-03-30', '0000-00-00'),
(799, 1219, 1217, 2, 6, '', '', 75, 25, 50, 'He has to work towards customer end. ', '2011-03-25', '2011-03-30', '0000-00-00'),
(800, 1219, 1217, 2, 5, '', '', 75, 50, 50, 'He has to communicate the things well in advance, so that if we have any issue on product deliverable, we could do some alternative path to complete the tasks. He should avoid passing last minute information to the manager', '2011-03-25', '2011-03-30', '0000-00-00'),
(801, 1219, 1217, 3, 15, '', '', 100, 50, 33.3, 'He should align to the team and manager to produce the results', '2011-03-25', '2011-03-30', '0000-00-00'),
(802, 1219, 1217, 3, 19, '', '', 75, 25, 33.3, 'Till now he is contributing like individual developer.\n\nBasically he has never taken ownership of any tasks.', '2011-03-25', '2011-03-30', '0000-00-00'),
(803, 1219, 1217, 3, 20, '', '', 75, 25, 33.4, 'He is planning skills are very much lacking. He has to plan well to deliver the output on time and high quality and also should adhere to the software processes ', '2011-03-25', '2011-03-30', '0000-00-00'),
(804, 1219, 1217, 4, 25, '', '', 75, 75, 22.2, '', '2011-03-25', '2011-03-30', '0000-00-00'),
(805, 1219, 1217, 4, 26, '', '', 75, 50, 22.2, 'As a senior member in the team, he has to provide pro active solution, writing some utilities will be very much handy to the product. Should lead the team from front to deliver the product on time', '2011-03-25', '2011-03-30', '0000-00-00'),
(806, 1219, 1217, 4, 28, '', '', 100, 75, 11.2, 'He should have right temperament to work, behave and communicate', '2011-03-25', '2011-03-30', '0000-00-00'),
(807, 1219, 1217, 4, 23, '', '', 75, 75, 22.2, '', '2011-03-25', '2011-03-30', '0000-00-00'),
(808, 1219, 1217, 4, 18, '', '', 100, 75, 22.2, 'He should acquire the functional knowledge very quickly and he has to reply quickly and right time. In fact he should adapt to the situation very fast.', '2011-03-25', '2011-03-30', '0000-00-00'),
