(8079, 809, 811, 1, 13, '', '', 50, 75, 50, 'The appraisee was not aware that the criteria for each parameter is displayed as a roll-over. She has rated herself on the basis of the overall rating displayed on top. After being appraised of the misunderstanding she has now given her self-rating again. These are listed below for all the parameters under the respective tabs:\nSelf rating:\nQuantity of work: B', '2011-03-29', '2011-03-29', '0000-00-00'),
(8080, 809, 811, 2, 2, '', '', 50, 75, 12.5, 'Appraisee''s self-rating:\nAttendance: A\nAttitude towards fellow employee: A\nAttitude towards superior: A\nCommunication: A\nFlexibility: A\nPunctuality: B\nReviewer: Informs about her own leave in advance.\nBut others'' leave does not get factored in. Hence rated B against attendance', '2011-03-29', '2011-03-29', '0000-00-00'),
(8081, 809, 811, 2, 3, '', '', 75, 100, 12.5, 'Her own original rating was due to misunderstanding of the criteria for rating. Is very friendly and helpful with colleagues.', '2011-03-29', '2011-03-29', '0000-00-00'),
(8082, 809, 811, 2, 4, '', '', 75, 100, 25, 'Her own original rating was due to misunderstanding of the criteria for rating. Has excellent attitude towards superiors.', '2011-03-29', '2011-03-29', '0000-00-00'),
(8083, 809, 811, 2, 5, '', '', 75, 75, 25, '', '2011-03-29', '2011-03-29', '0000-00-00'),
(8084, 809, 811, 2, 8, '', '', 75, 100, 12.5, 'Always keeps track of the end of the assigned work and informs well in advance, willing to be redeployed wherever required.', '2011-03-29', '2011-03-29', '0000-00-00'),
(8085, 809, 811, 2, 9, '', '', 50, 75, 12.5, 'Has always been prompt in reporting to work. Always on time and does not waste time on the floor.', '2011-03-29', '2011-03-29', '0000-00-00'),
(8086, 809, 811, 3, 16, '', '', 50, 75, 50, 'Self rating: \nCompliance: B\nPlanning: B\n\nReviewer: Agree with her rating.', '2011-03-29', '2011-03-29', '0000-00-00'),
