(8799, 1203, 1197, 3, 20, '', '', 100, 50, 50, 'Utilization of resources has been planned well, but need to learn more in planning on how to manage multiple assignments without any follow ups.', '2011-03-29', '2011-03-29', '0000-00-00'),
(8800, 1203, 1197, 4, 24, '', '', 100, 50, 20, 'Need to take ownership in giving seminars or sessions to improve the domain knowledge across the team.  Need to gain more experience in mentoring the team with business and system flow. Need to be proactive in giving appropriate examples for any complex solutions. ', '2011-03-29', '2011-03-29', '0000-00-00'),
(8801, 1203, 1197, 4, 26, '', '', 75, 50, 40, 'Knowing the production process well, Sowmya has not taken any additional ownership in developing the system for the betterment of production.  Most of the critical scenarios were not thought through in a better way or tested which came out during the UAT. Need to improve more in being proactive to provide better solution requirement in the first place without any follow ups. ', '2011-03-29', '2011-03-29', '0000-00-00'),
(8802, 1203, 1197, 4, 27, '', '', 75, 50, 20, 'Need to improve in learning new technologies required for software testing.  ', '2011-03-29', '2011-03-29', '0000-00-00'),
(8803, 1203, 1197, 4, 28, '', '', 75, 25, 20, 'Being a leader managing own emotions is more important which could guide the team members in the right way. There had been situations were team not being comfortable. Need to be very open enough to update the status to immediate managers as the first step.', '2011-03-29', '2011-03-29', '0000-00-00'),
(8804, 1222, 1217, 1, 1, '', '', 100, 100, 50, '', '2011-03-29', '2011-03-30', '0000-00-00'),
(8805, 1222, 1217, 1, 13, '', '', 100, 75, 50, 'Frequently takes action without being asked or told by a peer or supervisor. Persistent in overcoming obstacles. Consistently produces work under minimal supervision, but in terms of quality, he needs to learn', '2011-03-29', '2011-03-30', '0000-00-00'),
