(11151, 1195, 1197, 1, 12, '', '', 100, 75, 33.3, 'Bala being one of the critical resource in EMS, had been responsible for major part of the production module. He had been owning the complete responsibility in solving all technical issues across the team. The improvement area is, to make sure the deliverable are planned well ahead of time and delegated to the appropriate people to manage multiple task. Need to improve in delivering task on time.  ', '2011-03-30', '2011-03-30', '0000-00-00'),
(11152, 1195, 1197, 1, 13, '', '', 100, 75, 33.4, 'Need to improve in delivering unit tested code. This is mainly to focus on reducing critical or blocker issues when a module is released.', '2011-03-30', '2011-03-30', '0000-00-00'),
(11153, 1195, 1197, 2, 6, '', '', 100, 75, 50, 'Need to gain more learning experience in handling project demos from customer front, had to be very flexible in presenting the system and knowing the business need for any critical problems.', '2011-03-30', '2011-03-30', '0000-00-00'),
(11154, 1195, 1197, 2, 5, '', '', 100, 75, 50, 'Need to be more proactive in prompting or communicating the task delivered to the testing team.  ', '2011-03-30', '2011-03-30', '0000-00-00'),
(11155, 1195, 1197, 3, 15, '', '', 100, 75, 33.3, 'Bala has been a good contributor in recruiting people and available at all times.  He need to improve more in mentoring the team and grooming them for the betterment of their career.  ', '2011-03-30', '2011-03-30', '0000-00-00'),
(11156, 1195, 1197, 3, 19, '', '', 100, 100, 33.3, 'Need to improve in taking ownership to improve process at the organizational level.  Knowledge sharing sessions need to be enabled at global level for training employees across the organization.', '2011-03-30', '2011-03-30', '0000-00-00'),
(11157, 1195, 1197, 3, 20, '', '', 75, 75, 33.4, '', '2011-03-30', '2011-03-30', '0000-00-00'),
(11158, 1195, 1197, 4, 25, '', '', 100, 75, 22.2, 'Need to gain relevant experience in grooming the resources and train people to solve any critical problems rather taking complete load on to one person.', '2011-03-30', '2011-03-30', '0000-00-00'),
(11159, 1195, 1197, 4, 26, '', '', 100, 100, 22.2, '', '2011-03-30', '2011-03-30', '0000-00-00'),
(11160, 1195, 1197, 4, 28, '', '', 100, 75, 11.2, 'Being a leader need to be very open in understanding or accepting all the business demands which keeps changing based on customer needs.  ', '2011-03-30', '2011-03-30', '0000-00-00'),
