(11495, 869, 866, 3, 36, '', '', 75, 50, 33.4, 'Keerthana''s is yet to learn to do planning for long term. Usually at the start of a project a schedule would be drawn with the broad dates. This is followed by PMs.I have suggested her to draw out a complete schedule with respect to her activities at the setup stage itself that gives a visibility for the entire duration of the project with respect to a PMs activities. ', '2011-03-30', '2011-03-30', '0000-00-00'),
