(11501, 89, 87, 1, 11, '', '', 100, 50, 33.3, 'She has got a lot of ambition for growth, but not backed up by her efforts and attitude. She does not give importance to the instructions given to her by her superiors, does not know how to behave in a structured organization. She is a loner and do not have the capability to guide or control a team.', '2011-03-30', '2011-03-30', '0000-00-00'),
(11502, 89, 87, 1, 12, '', '', 100, 75, 33.3, 'She does the work according to her own wishes, giving least priority to the job given to her by her superior. Need many follow up on jobs, which could have been done very easily', '2011-03-30', '2011-03-30', '0000-00-00'),
(11503, 89, 87, 1, 13, '', '', 100, 50, 33.4, 'She has been doing the process audits and DJA audits during last year. \nRegarding quality, her reports have lot of assumptions and inferences, which is not expected from an auditor (Auditor is supposed to give only the objective evidence of her findings at the time of audit).\nMany times, her reports do not have the concurrence of the auditees, which again is a serious lapse in quality\nHer audits have certainly improved the discipline in the organization, but have not helped in an attitudinal change towards improvement from the auditees.', '2011-03-30', '2011-03-30', '0000-00-00'),
(11504, 89, 87, 2, 6, '', '', 100, 100, 50, '', '2011-03-30', '2011-03-30', '0000-00-00'),
(11505, 89, 87, 2, 5, '', '', 100, 25, 50, 'She is very poor in communication, gauged by the fact that she was talking in her appraisal for about50 minutes (in a total of 60 min). She does not have listening ears and keep on repeating whatever she says.', '2011-03-30', '2011-03-30', '0000-00-00'),
(11506, 89, 87, 3, 15, '', '', 100, 25, 33.3, 'She is not aligned to her superiors and has failed to earn the confidence of her superiors.She does the work what she likes rather than what is assigned to her.She always sees the issues only from her perspective and do not align her thinking to others.', '2011-03-30', '2011-03-30', '0000-00-00'),
(11507, 89, 87, 3, 19, '', '', 100, 100, 33.3, '', '2011-03-30', '2011-03-30', '0000-00-00'),
(11508, 89, 87, 3, 20, '', '', 100, 100, 33.4, '', '2011-03-30', '2011-03-30', '0000-00-00'),
(11509, 89, 87, 4, 25, '', '', 100, 50, 22.2, 'Yet to be tested. She does not come out of her shell and take initiative to lead and guide the juniors in the department.', '2011-03-30', '2011-03-30', '0000-00-00'),
(11510, 89, 87, 4, 26, '', '', 100, 100, 22.2, '', '2011-03-30', '2011-03-30', '0000-00-00'),
(11511, 89, 87, 4, 28, '', '', 100, 25, 11.2, 'Always get into arguments with the persons with whom she interacts. Does not have regards for human sensitivities, though she expects her superiors to respect her sensitivities.\nShe never takes the feedback given to her in a positive manner and no improvement in attitude over the last 3 years, even though the same feedbacks are given again and again during her appraisals and during any counseling sessions with her.', '2011-03-30', '2011-03-30', '0000-00-00'),
(11512, 89, 87, 4, 23, '', '', 100, 25, 22.2, 'Never able to convince others about her intentions about the job she is doing. Always views others work with suspicion and her work is viewed with suspicion by others. Unable to work in a team environment and create good will among team members in achieving common goals.', '2011-03-30', '2011-03-30', '0000-00-00'),
