(1, 208, '', 83, '', '', '', 0, '', '', 0, '', '', '', '', '', 'Save', '', '', '', 0, '', '2011-03-24', '2011-03-26'),
(2, 209, '', 87, '01-04-2011/09:03:54', '', '', 82, '06/04/2011 05:30 pm', 'He may be offered a take home salary of Rs. 11000 take home.\r\n\r\nJustification: \r\nIn short span of time, he had been a sourcer, recruiter and independently handled responsibilities of HR Executive and been an integral part of HR Recruitment.\r\n\r\nHe has been a great team player.', 100, '', '', '', '', '', 'Submit', 'Submit', 'Save', '', 0, '', '2011-03-24', '2011-04-01'),
(3, 683, '', 0, '24-03-2011/11:31:46', '', '', 86, '05/04/2011 04:00 pm', 'A good team player. Efficient in his work. \r\n\r\nNeed to improve in communicating within the team. Should provide feedback to the team members for their work.', 100, '15/04/2011 11:00 am', '', '', '', '', 'Submit', 'Submit', 'Submit', '', 100, 'Submit', '2011-03-24', '2011-03-24'),
(4, 603, '', 95, '30-03-2011/02:15:41', 'My previous roles are:\r\nLead the team members in the morning shift and general shift. E-mails handling and projects incharge of (MHSEG-C). High skilled in CTB Projects and MG_School books .\r\n\r\nMy Current role: (Last 5 months)\r\nProduction the e-book (pages)(Novella and OLC) projects. Creation Asset Map, Grep Checking, Image Upload, QA report Error fixing and Image Capturing and Alterations using Photo-shop and Gimp applications. ', 'a. Quote Creation.\r\n\r\nb. Automation Script Writing.\r\n\r\nc. Auto tagging and Template/sample creation in E-Book.\r\n\r\nd. PDF to XML and XML to HTML conversion procedures with automation.\r\n', 0, '', '', 0, '', '', '', '', '', 'Submit', '', '', '', 60, 'Submit', '2011-03-24', '2011-03-30'),
(5, 1200, '', 95, '30-03-2011/03:34:13', 'Giving Productivity not only in my domain (DB). Also Taking care of UI design and keep improving it as a single person, Taking ownership on collecting Business requirement and transforming it in a right way to developers, personally involving myself in testing to find any functional gap in system.\r\n\r\nAlso taking ownership to Setup DEMO for customers and top-management whenever required.\r\n\r\nAlways analyze the requirement and data before designing database objects so that no changes needs often. Even, when new requirements comes, the existing design can be easily migrated without major modification. \r\n\r\nMeeting customers (end-user) in person and understanding their workflows and concerns. Always maintaining good relationship with customer and attending their queries thru both mails and phone calls.\r\n\r\nAs I am having production background, understand the business better and communicate the needs to development team in a better way.\r\n\r\nAlways maintains a good relationship with team members so that we can share our thoughts easily and close loopholes if any.\r\n\r\nEven though I am not Web designer, learnt CSS myself and developed good UI for EMS and got appreciation from Krishna(COO) for this. By using 3-party tools, maintaining & monitoring database.\r\n\r\nWorked on many holidays and spent extra hours almost daily to meet tight schedules and deliverables.\r\n', '', 89, '11/04/2011 07:36 pm', 'Saga has been a very good team player and managed multiple work at any given point of time.  He has shown good output in both data modelling and developing prototype.  He has taken more effort in analyzing the requirement from scratch. Saga being a major contributor in the development of EMS, I Appreciate his multi-talented skill and commitment towards work. he has been leading the team from business front and had contributed most of his time in solving the business need.  He had been involved doing functional testing before it is released to the testing team which helps the team to fix any functionality gaps. \r\n\r\nHe need to improve more in database administration activities, data warehousing and other database applications for improving the overall performance of the organization.   ', 0, '', '', 'Y', '', '', 'Submit', 'Submit', '', '', 0, '', '2011-03-24', '2011-03-30'),
(6, 557, '', 94, '28-03-2011/11:04:38', '', '', 92, '06/04/2011 11:15 am', '', 0, '', '', '', '', '', 'Submit', 'Submit', '', '', 100, 'Submit', '2011-03-24', '2011-03-28'),
(7, 520, '', 65, '25-03-2011/10:43:11', '', '', 71, '05/04/2011 03:00 pm', 'Though she is new, she has learnt things very fast and has contributed much in meeting the deliverables.', 0, '', '', '', '', '', 'Submit', 'Submit', '', '', 60, 'Submit', '2011-03-24', '2011-03-25'),
(8, 46, '', 94, '29-03-2011/09:37:52', '', '', 79, '10/04/2011 10:00 am', '', 0, '', '', 'Y', '', '', 'Submit', 'Submit', '', '', 60, 'Submit', '2011-03-24', '2011-03-29'),
(9, 1214, '', 100, '29-03-2011/07:05:54', '', '', 94, '09/04/2011 05:00 pm', 'Diversified thinking, very vibrant and ready to take up challenges. Flexible working nature. Quick learner and highly reliable and dependable.', 0, '', '', 'Y', '', '', 'Submit', 'Submit', '', '', 0, '', '2011-03-24', '2011-03-29'),
