(88, 997, '', 96, '30-03-2011/02:30:30', 'I am working for last five years in this company, but my designation is Junior Executive till date. I am expecting you will consider on this and will do the appropriate position change.', 'I need training on creating InDesign templates.\r\n\r\nI am more interested to learn eel and perl scripts, because I have knowledge in programming languages.\r\n', 98, '08/04/2011 12:00 am', 'Does good amount of Research and attends to problem solving. \r\n\r\nNeeds to learn InDesign and Wiley3GXMT\r\n', 100, '16/04/2011 11:00 am', 'Saminathan is very dedicated and sincere to work. He is one among who has shown great improvements in the current period. He has gained the confidence of his TL (Sujatha) and one of the trust-worthy template creator. He will be able foresee issues and takes counter measures while template creation.\r\n\r\nHe started as LaTeX compositor and moved into Template creation. He is knowledgable in handling/editing PDFs, handling PitStop actions, fonts as well.\r\n\r\nVolunteer himself to extend his work or come on holidays when situations demands it.\r\n\r\nSaminathan is one among the very good employees of LW. His designation still a Junior Executive, which need to be revisited.', '', '', '', 'Submit', 'Submit', 'Submit', '', 0, '', '2011-03-25', '2011-03-30'),
