(115, 1006, '', 91, '28-03-2011/02:06:52', '', '', 98, '19/04/2011 11:00 am', 'Very few minor errors will not be considered. But, try to avoid those kind of minor errors.', 100, '15/04/2011 05:00 pm', 'Sudha is excellent with the quality of work. But last year (FY09) she was kind not very regular to work due to her health reasons - most of which we didn&#039;t had sufficient notice to make an alternate plans, which left the team having more troubles on the projects planned with her. \r\n\r\nBut in the current year (FY10), she had improved a lot and there were no surprise leaves and she continue to perform good on the quality of work as well.\r\n\r\nCommunication is the main barrier, which needs to be overcome in the coming days.', '', '', '', 'Submit', 'Submit', 'Submit', '', 0, '', '2011-03-26', '2011-03-28'),
(116, 1009, '', 91, '26-03-2011/11:07:49', '', 'I need training for Indesign Pagination', 94, '07/04/2011 12:00 am', 'She is handling projects very well and def. pages also very less. She is understanding the crisis situation and helping more.\r\n\r\n', 100, '15/04/2011 03:00 pm', 'Joice is a paginator one who gained much of her TL&#039;s (Sasi) reputation in this year. Shown a greater attitude towards the work and fellow employees.\r\n\r\nFamiliar with all the workflows and processes, waiting for her opportunity into eBook creation.\r\n\r\nVolunteered to stay back or even work on holidays when situation demanded! Keep the good working going!!', '', '', '', 'Submit', 'Submit', 'Submit', '', 0, '', '2011-03-26', '2011-03-26'),
