(254, 1033, '', 99, '28-03-2011/10:08:03', '', '', 97, '05/04/2011 12:00 am', '', 100, '15/04/2011 11:00 am', 'Sumathy is one of the two 2nd-levels to her TL (Anitha). She is continuing her good services to the team as she always.\r\n\r\nShe knows both LaTeX and InDesign paging.\r\n\r\n', '', '', '', 'Submit', 'Submit', 'Submit', '', 0, '', '2011-03-28', '2011-03-28'),
(255, 999, '', 100, '29-03-2011/09:00:30', '1. I have not produced any pages, however I was able to attend to journals and books template problems quickly without much issues.\r\n\r\n2. Kindly check with Malathi for other additional works done.\r\n\r\n3. Handled projects within my team during crisis without seeking help from other teams.\r\n\r\n4. Developed Indesign Template creators as this has been a new requirement. \r\n\r\n5. Developed Wiley 3G XMT for Books.\r\n\r\n6. Wiley 3G XMT for Journal is in Process.\r\n\r\n7. Lots of Work done for Demo purpose.', '', 98, '06/04/2011 10:54 am', 'Sujatha was amazing in her attitude and committment to work. She manages the template creation of the entire Professional Enterprise. She also plays a good role in any analysis related to paging and templates.\r\n\r\nFew observation of mine about her are:\r\n\r\n1. Overall its very a good performance of you and your team\r\n2. The way you managed unpredictable loads, load spikes, and accommodating any additional requests from PTG were amazing\r\n3. XMT for Wiley3G was an achievement for you\r\n4. Handling InDesign template creation within the LaTeX template team was an achievement\r\n5. The temperament has improved and been excellent\r\n6. Need to build a good 2nd-level subordinate within the team, so that it helps to make yourself available for next leap\r\n7. Bring in control mechanism within the team - template creation, so that less supervision will be required, greater control on quality. One is tracking of feedbacks from client &amp; comp teams, as we started once. The other could be scheduler, etc\r\n8. There is a good scope for exposing our expertise on template creation to client, by means of we making sensible suggestions/options/challenges we faced and how we tackled, what could be the possible troubles if by following a particular design in the way it has been requested, etc \r\n9. I know knowledge sharing happens in your team, but conduct them in a more formal manner to get better results - do it in a conference room preferably to get more attention and less distraction to others in the floor, record the knowledge shared with, people attended, etc\r\n10. Try to create a Do&#039;s and Don&#039;ts for template, XMT, Sample creations that should help when you teach a new member in your team and you don&#039;t have reinvent the wheel with them.\r\n11. Creating a formal training module on LaTeX template creation - will help to train easily and in a proper order\r\n12. Our challenge for the coming year could be the transition:\r\na. from WileyML2.1 to 3G for all divisions in Wiley\r\nb. could be also migrating into InDesign and we should be getting our people trained on ID and getting into XML-first route in ID\r\nc. May be we have familiarize ourselves to new DTDs from different new clients&quot;\r\n\r\n13. FY12, our main focus should be on stabilizing all our processes, tools, templates, thereby bring in simplified worflow and processes, which can result in enhanced efficiency, increased productivity, less person dependency -- for you to start with documenting the template creation processes.\r\n\r\nTo me Sujatha is a bit overloaded and if we can have relieve her a bit of her current responsibilities, she will be able to bring in more controls through the templates.\r\n', 0, '', '', '', '', '', 'Submit', 'Submit', '', '', 0, '', '2011-03-28', '2011-03-29'),
(256, 1117, '', 98, '28-03-2011/10:56:18', '1.Ability to handle projects Individually.\r\n2. Can lead a team and handle projects effectively on schedule.\r\n3. Can deliver more projects on time and within budjet.', 'Need Project Management training and my goal is to do PMP Certification', 96, '06/04/2011 09:00 pm', 'Needs to be trained in management skills. Is groomed to be a PM.Good at multitasking, prioritizing the job and planning.Should have command over the team in the absence of the PM.Regular and ready to handle responsibilities.Struggles at times to maintain work life balance.Needs improvement i communication to express her views in speech.', 100, '12/04/2011 12:00 am', '', '', '', '', 'Submit', 'Submit', 'Submit', '', 100, 'Save', '2011-03-28', '2011-03-28'),
