(261, 1004, '', 98, '28-03-2011/10:29:25', 'Based on my role, I am doing my work perfectly.', '', 98, '06/04/2011 04:00 pm', 'Prema is very professional and capable employee of LW.\r\n\r\n1. Overall its very a good performance of you and your team\r\n2. The way you managed unpredictable loads, load spikes, and accommodating any additional requests from me was amazing\r\n3. I have seen you to be more formal than any of my TLs\r\n4. Record maintenance is good -- tracking the errors made by reviewer serve as a control mechanism, but try to make it a formal by presenting it in a team meeting\r\n5. Build a solid 2nd-level in the team, so that it helps you make yourself available for next leap\r\n6. Make your members independent and capable of drafting queries -- by creating exercises for them to draft queries\r\n7. Challenges next:\r\na. getting all the reviewers trained in WileyML 3G\r\nb. getting your members trained on ID pagination and to review ID files\r\nc. May be we have to familiarize ourselves to new DTDs from different new clients\r\n8. FY12, our main focus should be on stabilizing all our processes, tools, templates, thereby bring in simplied worflow and processes, which can result in enhanced efficiency, increased productivity, lesss person dependency -- for you to start with documenting the template creation processes', 0, '', '', '', '', '', 'Submit', 'Submit', '', '', 0, '', '2011-03-28', '2011-03-28'),
