(617, 1205, '', 91, '30-03-2011/02:24:29', 'Quantity of work &#65533;Assigned modules are achieved with in the target date and I will help team members to complete the works\r\nQuantity of work - My work mostly be a quality, maintain coding standards, implemented loggers,exception handlings, error message display and i wont write complected code even everyone understand\r\nAttendance-Mostly I didn&#65533;t tack the leave if require i will inform early. If any urgent work I canceled the leave and even came Saturday and Sunday\r\nAttitude towards fellow employees-Maintain good relationship with team members, if any issues in there work take additional effort to solve\r\nAttitude towards Superior(s)-Modules are finished by the date as superior assigned and follow the instructions what they given\r\nFlexibility &#65533; If any changes or modifications in my module cheerfully do that change, even I suggest some new things.\r\nPunctuality &#65533; Always available on time and finish my works within time\r\nCompliance to established methods &#65533; We have the discussion for assigned module and I suggest easiest ideas to improve business logic\r\nPlanning &#65533; Clearly plane the work based on the due date, if any team members assigned to me share the module and I make sure them not exceeding the time line\r\nKnowledge sharing &#65533; Share the knowledge with my team members, specifically I trained Freshers now they are doing separate modules\r\nProactive Solution Mindset- Module always flexible for future changes and provides the proactive solution\r\nSkill Acquisition  learn the all new technologies not only needed for our work. In feature it required will implement here', '', 78, '08/04/2011 08:14 pm', 'Viswa is one of the critical resource in EMS. He had been showing good performance from day one in understanding the wicket framework and publishing requirement within a short period of time.  He has been very flexible in accepting the changes to modules and has shown good output in developing modules within the given time.  He had trained the new joinees and helped them in gaining wicket knowledge by continuous support and guidance. Has very good relationship with all fellow employees and helped most of the junior trainees providing better solution for their problems.', 0, '', '', 'Y', '', '', 'Submit', 'Submit', '', '', 0, '', '2011-03-29', '2011-03-30'),
(618, 109, '', 89, '30-03-2011/01:28:57', 'I have completed all my tasks successfully. \r\nI have done an appreciable work and my deliverable before cut off date and with less number of defects. \r\nMy current CTC is very low compared with my experience and skills, so I expecting a better compensation from this appraisal. ', '', 79, '06/04/2011 11:00 am', 'Completed the given task successfully. Being as a first year in scripting, learn and works extremely well, co-ordination with colleagues also good. Guidance required in some cases.', 75, '11/04/2011 12:00 am', '', '', 'Y', '', 'Submit', 'Submit', 'Submit', '', 0, '', '2011-03-29', '2011-03-30'),
