(620, 203, '', 0, '06-04-2011/12:23:40', '', '', 76, '06/04/2011 11:30 am', 'HE HAS STARTED TO HANDLE RECRUITMENT AND POST RECRUITMENT ACTIVITIES ALL BY HIMSELF.\r\n\r\nHAS TO WORK ON LITTLE MORE EFFECTIVELY TO SETTLE THE STATUTORY AND OTHER RELATED ISSUES.\r\n\r\nSHOULD START WORKING INDEPENDENTLY WITHOUT RELYING ON THE FAC I REPRESENTATIVES.', 0, '', 'Deva should improve the impact of his role in Nungambakkam. He should implement all processes and systems in Nungambakkam as they are in adyar.', 'Y', '', '', 'Submit', 'Submit', '', '', 0, '', '2011-03-29', '2011-04-06'),
