(632, 1203, '', 92, '29-03-2011/04:51:01', 'In Production Project Management - All the programs handle by me are successful. Appreciation from HMH during Monitoring perion on Adult Education program (Program even 1% of error is not acceptable as per Publishing standards). Huge Program Storytown TE and Ancillaries is with LW since April 2008 and program has gone for 2 reprints and still it is with LW. Even the client side Project managers do not have knowledge as they are new and old ones has quit/changed fields.\r\n\r\nIn Testing: \r\n\r\nI have worked on all the Products, accepted several responsibilities - Trained 10 Freshers, guided the testers, execute Load testing with guidance, co-ordinate with all the teams to do Load test, to execute PDF Previews and Round tripping.\r\n\r\n', 'It would be helpful to learn faster, if a training on DBMS is arranged. It would be helpful to check data stored in DBMS. \r\n\r\nIt would be helpful, if time is provided for me to explore Automation tools both for Regression and Load testing.', 56, '11/04/2011 06:42 pm', 'Sowmya has been recruited to software with an expectation to improve the overall performance the system.  She has been showing good output in testing the released functionality.  But need to improve in taking ownership to identify the functionality gaps from the production process. Need to plan well ahead of time what is missing or required for the system which could avoid any breakage in the flow of the system.  Need to gain more experience in mentoring and leading the team.', 0, '', '', '', '', '', 'Submit', 'Submit', '', '', 0, '', '2011-03-29', '2011-03-29'),
