(641, 986, '', 90, '30-03-2011/05:56:47', '', '', 92, '08/04/2011 12:00 am', 'A little emotional and sensitive person is Jayashree. But if she is handled properly she is very quiet and perform to her best.\r\n\r\n\r\n1. You should be happy now that you have a team directly under you and you are managing an important deliverable (both in terms of quality and schedule) and you are handling it pretty well\r\n2. Your planning is well, continue and improve on it\r\n3. You did a good job in creating a sample job covering all requirements, which helps you to easily train new members into eBook production process\r\n4. Should try a find a way and means of improving on the quality -- less on person dependency and more on tools \r\n5. The analysis on any issues has to be more detailed and thorough, so that you can address promptly of the issues in the input to you, also help you to bring in control mechanism within your team\r\n6. Communcation is good, but can improve\r\n7. We need to take the Epdf creation within the eBook team\r\n8. We need to prepare ourselves for the transition from 2.1 to 3G -- tools need to upgraded or recreated and process need to be revised as well\r\n9. FY12, our main focus should be on stabilizing all our processes, tools, templates, thereby bring in simplied worflow and processes, which can result in enhanced efficiency, increased productivity, lesss person dependency -- for you to start with documenting the template creation processes', 0, '', '', '', '', '', 'Submit', 'Submit', '', '', 0, '', '2011-03-29', '2011-03-30'),
