(699, 818, '', 98, '30-03-2011/06:42:39', 'Point A not applicable to my job role as I do not work with external customers/marketing. Request to please factor in this while computing the weightage.\r\n\r\nCustomer orientation: Please note that customer here implies internal customers (Project Management, Typesetting, PR, Fac II etc)\r\n\r\nOrganizing & Utilization of Resources: When the entire MRWs copyediting team left LW, that work has been taken on additionally by the existing Books I and Books II teams. Also, we are handling all this additional work with a whole set of newcomers and are driving this successfully without any glitches. This involves continuous on-the-floor training and monitoring along with production on a day to day basis.', '', 98, '06/04/2011 12:00 am', 'Dhanalakshmi Ram played a crucial role when we had key resources from MRWS core team leaving us. She took the challenge in her stride and helped in smooth transition. Particular mention needs to be made of the way she set up and handled the "Knipe" which had several style sheets and required relentless focus for quality and also visualizing the pitfalls.\r\n\r\nHer focus area will be training copyeditors in language aspects. ', 0, '', '', '', '', '', 'Submit', 'Submit', '', '', 0, '', '2011-03-29', '2011-03-30'),
