(701, 811, '', 98, '30-03-2011/05:04:28', '"Maintaining relationship with lost client with intention of revival" is applicable to me under growth orientation. Hence the rating B.\r\n\r\nOUP India is the only external client I deal with and our relationship with them is very good. Other than that there is no scope for us to directly interact with external clients. Hence PMs and typesetters have been considered our customers and the rating based on that. ', '', 96, '01/04/2011 12:00 am', '', 0, '', '', '', '', '', 'Submit', 'Submit', '', '', 0, '', '2011-03-29', '2011-03-30'),
