(772, 1029, '', 93, '30-03-2011/09:51:10', '', '', 91, '05/04/2011 12:00 am', '', 75, '16/04/2011 12:00 pm', 'Kayal is among the fastest compositor on TD-Line projects - which is a very fast turn-around projects, in InDesign compositions. \r\n\r\nBeing so fast there were couple of some minor quality issues as well. If she find a balance between speed and accuracy then she can be among the best.\r\n\r\nWorks both on InDesign and LaTeX paging.\r\n\r\nShe had to be on long leaves a couple of times due to ill-health, but during those days the communication could have been more effective from her side.\r\n\r\nGood compositor to have.', '', '', '', 'Submit', 'Submit', 'Submit', '', 0, '', '2011-03-30', '2011-03-30'),
