(776, 113, '', 94, '30-03-2011/10:31:57', 'According to my knowledge, last financial year mold me a lot.\r\n\r\nI improved in mindset, communication, planning, resource management, temperament and technical skills. This is 50% because of you.\r\n\r\nStill some of the things need to improve, I will improve that in coming year.\r\n\r\nTeam meetings needs to be continued...\r\n\r\nArrange team outing, It will create a inter personal relation ship.', '', 88, '11/04/2011 12:00 am', '', 0, '', '', 'Y', '', '', 'Submit', 'Submit', '', '', 0, '', '2011-03-30', '2011-03-30'),
