(778, 1014, '', 100, '30-03-2011/10:11:00', '', '', 98, '07/04/2011 12:00 am', 'Poonodi will be handling very tough project smoothly and training all the process very well. ', 100, '15/04/2011 02:00 pm', 'Poongodi is one among the senior compositors in the Wiley-Books cluster. Very confident with her work is what I have seen her to be. One of the favorite compositors of the TL (Sasi).\r\n\r\nShe is well versed in all the workflows and processes. Recently she started with paging in InDesign as well.\r\n\r\nMay be she has to get opportunity to learn into eBook creation and more InDesign paging, which I am sure she will get her turn soon.\r\n\r\nCan reach better heights if her English language and communication can be improved.\r\n\r\nNext could be she can play her role in review or template team, as her next leap.', '', '', '', 'Submit', 'Submit', 'Submit', '', 0, '', '2011-03-30', '2011-03-30'),
