(791, 1036, '', 82, '30-03-2011/11:30:59', '', '', 85, '07/04/2011 12:00 am', 'He is good attitude guy and good at work. And he is very flexible and taking ownership of the projects, much appreciated. Sincere and dedicated too..', 75, '15/04/2011 07:00 pm', 'Aejaz has a good attitude and a jovial guy. He s getting nurtured on the book production processes. He was picking up a little slow, but can come up.\r\n\r\nHe has learnt XML conversion, LaTeX paging as well and on eBook creation. Spent a fair amount of his time this year in the eBook creation.\r\n\r\n\r\n\r\n', '', '', '', 'Submit', 'Submit', 'Submit', '', 0, '', '2011-03-30', '2011-03-30'),
(792, 1027, '', 82, '30-03-2011/11:36:41', '', '', 92, '07/04/2011 12:00 am', 'Anitha manages the TD-Line and Jossey-Bass division of Wiley. The TD-Line division projects are fast turn-around and she manages the schedule extremely well with almost no issues from client on schedule.\r\n\r\n1. Overall its very a good performance of you and your team\r\n2. The transition of TD-line from LaTeX to InDesign was nicely done\r\n3. The way you plan, assign, and turn-around the TD-line projects, I think you are the best in that!!\r\n4. You have to continuously plan (almost everyday) and you are good in that\r\n5. Your are excellent with your administrative work as well -- record maintenance!\r\n6. There is a fair scope to improve on the communication -- on to the details in the emails and language used\r\n7. If you make a little more effort, the quality can be under your control - like random monitoring, can help to enhance the quality of the products, and can bring in more control towards you\r\n8. Though you have solutions on your own, many times your require a advise/confirmation from superiors or colleagues on that. You can analyze well before arriving at a solution and then be confident of your solution\r\n9. Challenges for the coming year:\r\na. getting things straight with the post-composition production process simpler -- extraction of rtf and going into XML or should think about going into XML-first flow in ID too\r\nb. getting all the members and you trained in WileyML 3G so that there can be is a transition from 2.1 to 3G, it will be smooth\r\n10. FY12, our main focus should be on stabilizing all our processes, tools, templates, thereby bring in simplied worflow and processes, which can result in enhanced efficiency, increased productivity, lesss person dependency -- for you to start with documenting the template creation processes', 0, '', '', '', '', '', 'Submit', 'Submit', '', '', 0, '', '2011-03-30', '2011-03-30'),
