(803, 1195, '', 98, '30-03-2011/12:50:38', 'Growth Orientation: \r\n    Ownership of setting up EMS demos for clients like Pearson,Elsevier and  to make sure that Laserwords win contracts or projects to improve their profitability.Setting of EMS Demos who are interested in EMS as a Tool where the requirements of each client will be met like Wiley books and Mc graw hill.\r\nWorking closely with cluster to understand their business needs and help to improve their process and productivity.Providing business support and technical support for EMS UAT.\r\n\r\nProductivity: \r\n   Worked Saturdays and holidays to deliver the deliverable s on time. my average working hours is about 10 hours a day excluding my break hours. Involved at all stages of Software life-cycle in EMS and proven my capability and maximized , adopted to various levels of needs during the development of EMS.\r\n     \r\nQuality of Work: \r\n   Followed  and implemented the coding standards to improve the quality of work.Worked hard to improve the performance of the application by implementing performance improved techniques.Made sure that the defect density is very less.\r\n\r\nCustomer Orientation: \r\n   Responds to e-mail and meeting requests immediately.Communicating what the customer or clients wants via modes such as direct interaction and meetings includes goto meetings.Maintaining a rapport support to customer and provide solutions \r\nor work around to their issues.Resolving the immediate blockers for the customers and communicating back with resolved queries.Addressing various queries and maintain effective communication with client.Maintaining customer support , \r\nresolving issues, giving more priority to customer concerns and issues. providing and implementing common solutions and helping the clients to understand the process and importance of process.\r\n\r\nCommunication:\r\n    Responding to E-mail communication within the team and across the company in appropriate time.following E-mail etiquette and made sure the use of right expressions and words to communicate the message.Made sure that right message reaches right people with clarity and feedback for the message sent.Communication via English during official meetings and communicating to people in the manner they understand better.\r\n\r\nAlignment:\r\n   Helped the sub-ordinates in developing their technical skills and there by increasing the productivity of the organization.Interviewer for java and fresher candidates to analyze their technical strength and skill set ,to bring them to the organization.Motivate the freshers to work hard and help them to understand the company process and to strengthen the bonding between employees and organization.participated in various functions organized by company. Followed the process and policies laid by organization such as Dress coding.\r\n\r\nOwnership:\r\n  Took ownership of developing process and helped to improve the team spirit.helped to build the Team culture and software culture in this organization.developed the base of EMS and helped the team to move across to build relationships and build their technical knowledge.helped the sub ordinates in building their career and motivated the team to choose the right path.\r\n\r\nPlanning:\r\n  Provided the right plan and time for the deliverable,and merged with superior planning to make sure that customers are happy about their deliveries.Made sure that team proceeds as planned to meet the deadlines.provided with alternate plans to meet the deadlines.helped the supervisors in implementing their plans.\r\n\r\nOrganizing & Utilization of Resources:\r\n        Proactive in developing the application keeping in future requirements and keeping the future focus of EMS.Utilized the resources in best form to deliver the EMS for UAT and motivated the team for their ultimate prize.Provided alternate solution to make the customers happy by resolving their queries.Allocated work to sub-ordinates based upon their potential and made sure that they deliver quality work.Resolved issues even at the toughest times.\r\n     \r\nProactive Solution Mindset:\r\n     Proactive in gathering requirements from business owners , developing the same and made sure that the product reaches the customers on time.setting the process and process in the team to improve the productivity and improve the quality of code.handled almost every part of software life cycle in EMS.\r\n\r\nTemperament:\r\n   Handled pressure situations with smartness and made sure that team delivers the product with quality ,and extracted work from all team members to meet the deliverable s.Developed good team spirit and developed the team culture to develop EMS.\r\n\r\nInterpersonal & Team Relationship:\r\n        Brought team culture , unity is strength and good team rapport ,good interpersonal skills to develop team spirit among the spirit.Synergy in the building.helped to create a good team atmosphere where there will be fun at work.\r\n            \r\nFunctional Knowledge & Application:\r\n         Have sound technical knowledge and all technical issues are resolved in EMS.Developed sound business knowledge in e-publishing business to understand their business and process , and made sure that all their needs are replicated in EMS.', '', 85, '11/04/2011 08:20 pm', 'Bala is one of the critical resource of EMS, he is the major contributor of all critical modules in EMS. He has been involved from the architecture design to low level coding and has taken ownership in delivering all modules without any superior guidance on technical front. He has helped all the team members to gain wicket knowledge and helped them in solving technical issues. He has been owning the responsibility of delivering task on time during my absence.  Need to gain more experience in handling people and communicating the status. Need to take additional responsibility in delivering the task on time with better planning and quality.', 0, '', '', 'Y', '', '', 'Submit', 'Submit', '', '', 0, '', '2011-03-30', '2011-03-30'),
