(829, 89, '', 98, '30-03-2011/06:39:12', 'DJA/Facility-wide Audits ...\r\nAchievements &#65533;\r\nFINANCIAL\r\n1.	Resulted in optimized utilization of resources (lowered operational costs)\r\n2.	The quantum identified in Resource Pool facilitated organizational recruitment/resource re-skilling or training & deployment planning, Facility-wide\r\n3.	Ensued  in meaningfully redirecting resources rather than parasitic consumption  &#65533; Resource management\r\nCUSTOMER/CLIENT RELATED  \r\n4.	Improved client front delivery of services (reduced  client delivery issues by 50% &#65533; \r\nFrom 23.8% (2009) to 11.5% (2010)\r\n5.	Improved customer satisfaction (on delivery &#65533; E.g. Journals client scores for delivery last 3 quarters)\r\nINTERNAL PROCESS & ALIGNMENT TO GROWTH\r\n6. Creation of robustness against disruption in operational environment.  \r\n7. Audit reports used by CLs/TLs as a disciplinary tool for raising the bar of the performance of their team members\r\n\r\nInitiatives &#65533;\r\nFINANCIAL\r\n1 Generating Daily & Monthly (operational) Resource Status Report (with division-wide status count) &#65533; mirrors the utilization of operational resource status. Facilitates decision making at operational/functional & management levels\r\nCUSTOMER/CLIENT RELATED \r\n2.	Consolidated DJA Discrepancy status & Cluster-wide discrepancy status &#65533; provides insight for improvement in efficient operation\r\n3.	Motivational educational material catered (on a weekly basis) to support continual self improvement & performance \r\nINTERNAL PROCESS & ALIGNMENT TO GROWTH\r\n4. &#65533;Throughput&#65533; evolved with DJA & PR Defective pgs inputs &#65533; an empirical measure of process/product improvement. Provided insight to cost efficient process/workflow.\r\n5.	Facility-wide DJA planning conformance random audit &#65533; ensures planning & timely allocation for all the shifts that clocks optimum utilization of resources & productivity\r\n6.	Reasons for Facility-wide planning  deviation reported (random audit) &#65533; To draw management decision/action\r\n7. Daily/Monthly/Random audit reporting format evolved to meet the functional/operational requirement of the Division Heads\r\nAwareness created &#65533;\r\nFINANCIAL\r\n1.	Lean allocation/partial utilization having a direct impact on the team&#65533;s cost factor \r\n2.	Improved awareness of optimal utilization of resource(s)\r\nCUSTOMER/CLIENT RELATED\r\n3.	Schedule adherence as a measure of performance\r\n4.	Daily feedback & reasons for deviations/discrepancy recorded/responses called for &#65533;\r\nINTERNAL PROCESS & ALIGNMENT TO GROWTH\r\n5.	Awareness of leadership&#65533;s sensitivity to the team and client schedule requirement/planning\r\n6.	Daily/random feedback on repeat/no change in allocation provided\r\n7.	Feedback on folder discipline highlighted\r\n8. DJA function has facilitated visible demonstration of planning and implementation as a key skill set for an efficient leadership\r\nOutcome &#65533;\r\nFINANCIAL\r\n1. Resource Pool utilization, resulted in a fiscal saving of about Rs 18 lacs this year\r\nCUSTOMER/CLIENT RELATED\r\n2. Accurate and efficient scheduling system has had a direct impact on the outcome of the business\r\nE.g. NIMAS, Journals, HMH, New clients &#65533;\r\nINTERNAL PROCESS & ALIGNMENT TO GROWTH\r\n3. Building capacity of leadership to comply client schedule and quality delivery \r\nE.g. TLs team handling capacity has increased from 6 members (2008) to an average of 18 members (32 members during peak)(2010-2011)\r\n4. Appreciation/feedback/suggestion received from Operational/Functional EG Heads, CLs & TLs', 'Information Sharing/Training Needs &#65533;\r\nFINANCIAL\r\n1.	Organizational (financial/operational/functional) programmes/communication/learning & developmental activities to be made available\r\n\r\n2.	Involving the functional team(s) appropriately aids organization to enhance the business outcome\r\nCUSTOMER/CLIENT RELATED\r\n3. Customer service improvements &#65533; systems and technology to measure customer satisfaction\r\nPROCESS RELATED & ALIGNMENT TO GROWTH \r\n4.	Information/awareness on internal process improvements/developments & allow participation\r\n5. Functional & application knowledge on the role played ', 63, '07/04/2011 04:00 pm', 'For the last 3 years many times she has been advised to improve her team work and work on attitudinal problems, but there is no improvement. With the focus of QA department on CMMI implementation and certification, she will not fit into any of the roles in QA. \r\n\r\nHer strong point is she is fearless to dig in and come out with a status report on any department/activity and if such reports can be validated by a neutral agency, we will be able to get a feel on the problems in that activity/department.And she can be effectively used, where disciplining is required.\r\n\r\nRecommend considering her for a suitable role suiting her strengths.\r\n\r\n', 0, '', '', 'N', '', '', 'Submit', 'Submit', '', '', 0, '', '2011-03-30', '2011-03-30'),
