(844, 1003, '', 100, '30-03-2011/04:28:21', 'I am interested doing LaTex Template. Already attend LaTex template class. Please do the needful.', 'Need to tranning for Indesign/IndesignTemplate', 98, '09/04/2011 09:17 pm', 'Compared to last year, he has shown a good improvement. But, he has to get improved more to manage a team.\r\n\r\nHe is capable of doing template creation and willing to learn template creation.', 100, '15/04/2011 05:31 pm', 'Loganthan a couple of years back was very rigid and completely inflexible to work requirements. But he showed tremendous change during these years under the leadership of Prema! He manages well now both his personal and official requirements though he has a lot of personal problems to tackle, as his father is suffering from kidney failure and is under treatment for quite some time now.\r\n\r\nHe is found to be a promising reviewer nowadays.\r\n\r\nLoganathan has to improve on the English language and communications.\r\n\r\nHe has gained the confidence of Sujatha as well to get into the LaTeX template creation, which could be his next leap.', '', '', '', 'Submit', 'Submit', 'Submit', '', 0, '', '2011-03-30', '2011-03-30'),
