(850, 1079, '', 85, '30-03-2011/05:13:41', '', '', 79, '08/04/2011 04:30 pm', 'Total Exp - 2.5 years in InDesign\r\n\r\nMy Feedback:\r\nNeed to concentrate more on improving Quality and Quantity.\r\nNeed to improve Communication skills (Handing over job, transferring instructions if any).\r\nNeed to analyze the job first before starting to work on it.\r\nNeed to learn Pitstop and develop her technical skills.\r\nWill work better under guidance.\r\n\r\nIndumathy Feedback:\r\nLike to work on PowerMath titles and high complexity projects.', 50, '11/04/2011 12:00 am', 'Wants to work out of Adyar.\r\nHas health issues.\r\n', '', '', '', 'Submit', 'Submit', 'Submit', '', 60, 'Submit', '2011-03-30', '2011-03-30'),
