(858, 668, '', 75, '30-03-2011/07:59:57', '2010-2011 was a challenging year for me in terms of taking up new projects with new clients which I (also my team) have achieved after several tests from the client to check our ability to work on Mathzone projects.\r\n\r\nThis year, I have got the confidence of handling a team strength of around 25 to 30 (SME and team members). I have handled different kind of people in different situations. I have made people to enjoy their work as it is very challenging and many of them work in their own subject area.\r\n\r\nSuggestion:\r\nTo motivate the team members, best performer awards can be given at least once in 3 months.', '1. Need to nominate a person to give training for LSI/pearson tool.\r\n2. Basic epsilon training.\r\n', 83, '15/04/2011 12:00 pm', 'Strengths:\r\n\r\n-Clear thought process in all tasks undertaken\r\n-High emotional intelligence in resource handling (team/sme&#039;s (in particular))\r\n-Goal driven, ability to see a task through completion\r\n\r\nAreas of Opportunity\r\n\r\n-Take a more lead role in verbal communication with clients\r\n-Invest more time in improving process efficiency\r\n\r\n\r\n', 0, '', '', '', '', '', 'Submit', 'Submit', '', '', 0, 'Submit', '2011-03-30', '2011-03-30'),
(859, 231, '', 100, '30-03-2011/05:44:23', '', '', 73, '07/04/2011 12:00 am', '', 75, '11/04/2011 12:00 am', '', '', '', '', 'Submit', 'Submit', 'Submit', '', 60, 'Submit', '2011-03-30', '2011-03-30'),
(860, 1044, '', 97, '30-03-2011/05:38:08', 'I hope Laserwords give a good opportunity (Team Leader) for my future currier.', 'I need a training of Indesign Template Creator and Latex Template Creator for my growth.', 95, '06/04/2011 12:00 am', 'Leema rose is doing very well. I am expecting she should start responding the client mail and send (of course on my checking and approval). Both on quality and quantity wise she improved a lot when compared to last year.', 100, '16/04/2011 11:00 am', 'Leema is very committed to the team and to work.\r\n\r\nShe learned and adapted well to the new requirement WileyML 3G from HE division of Wiley.\r\n\r\nExceeds expectations om productivity (&gt; 16EMCP).\r\n\r\nOn quality consistent and good -- no issues from her work\r\n\r\nRegularity to work: Good\r\n\r\nAnything unique to say: Volunteers herself of helping or resolving troubles in work that others might have\r\n\r\nSkill: Knows all the 3 workflows; InDesign exposure is there but didn&#039;t got an opportunity to work; D-XML process, WileryML 3G, CMS, etc.\r\n\r\nLeema is very good!', '', '', '', 'Submit', 'Submit', 'Submit', '', 0, '', '2011-03-30', '2011-03-30'),
(861, 874, '', 88, '30-03-2011/05:02:01', '', '', 87, '07/04/2011 08:00 pm', '', 0, '', '', '', '', '', 'Submit', 'Submit', '', '', 0, '', '2011-03-30', '2011-03-30'),
(862, 1047, '', 90, '30-03-2011/05:08:53', 'I performed very well in the last year. I had given an opportunity to work with 6 different clients at the same time and I accepted without any noise. I always maintained a good relationship with all my clients and managed the team without any major issues his year. Eventhough handling some client (OUP_INDIA) is very headache, since you may have to keep an eye always, I had planned my resouces in such a way that client never complined any time during the project. Overall I feel my performance was ver good.\r\n\r\n', '', 96, '06/04/2011 12:00 am', 'Praveen, he is really cool-headed and a silent performer. The major success of him was successful the training and transition of his team into WileyML 3G on Wiley-HE projects. Also he handled composition of most of the projects from new clients like Wiley-Canada, OUP-India, and Jones &amp; Bartlett. The following are my observations about him:\r\n\r\n\r\n1. Overall its very a good performance of you and your team\r\n2. Though the efficient process and tools are yet to be fully established, the transition from 2.1 to 3G was done without much noise from your end. Good work by you and by your team\r\n3. The cordial relationship that you maintain with client is extremely good. You are best in this, I should say!!\r\n4. You are a silent performer as well, almost everyday I can see outputs from your team.\r\n5. Coming to planning, you have the ability to plan and accommodate as an when things come to you. But this may not work always - especially when the load is more than your capacity. I know your attempts with client to get schedules failed couple of or even many times. But still we can&#039;t afford to loose control with. Ie., by means of sending a status report and requesting for a schedule or by means we proposing a draft schedule, etc whatever you think will work with the client in concern. \r\n6. Though you have solutions on your own, many times your require a advise/confirmation from superiors or colleagues on that. You can analyze well before arriving at a solution and then be confident of your solution\r\n7. Challenges for the coming year: \r\na. getting things straight with the 3G workflow and tools, processes\r\nb. Find means of going on 3G first route in ID, when design/client demands it\r\n8. FY12, our main focus should be on stabilizing all our processes, tools, templates, thereby bring in simplified workflow and processes, which can result in enhanced efficiency, increased productivity, less person dependency.', 0, '', '', '', '', '', 'Submit', 'Submit', '', '', 0, '', '2011-03-30', '2011-03-30'),
(863, 1005, '', 85, '30-03-2011/05:25:37', 'I got a appreciation mail from the client for the title "Pickett".', '', 90, '09/04/2011 06:08 pm', 'She has to develop the communication skill.', 100, '15/04/2011 05:45 pm', 'Asha one among the senior members in the Wiley-Books cluster is doing with the project review work.\r\n\r\nIf she develops her leadership skill, English language and communication, there is a fair chance for her growth.\r\n\r\nMay be kind of problems in her personal life would have prevented her from taking additional challenges, but I am sure she will come forward to take additional responsibilities and challenges.', '', '', '', 'Submit', 'Submit', 'Submit', '', 0, '', '2011-03-30', '2011-03-30'),
(864, 857, '', 92, '30-03-2011/05:20:17', '  Once again I take this opportunity to thank the Laserwords management for the support extended to me in my time of stress in the past two-and-a-half years.\r\n  With all the limitations of my illness and the continuing treatment, I have tried to give of my best, working a full shift and often from home too to pitch in with the increasing QC load in Books and Journals. \r\n  It would be good to have a full-fledged QC team in place in the Copyediting Department. I would like to share my knowledge acquired over the past two decades to the copyeditors. \r\n  We have newcomers who have end-to-end experience in copyediting. It would be good if we could locate someone with knowledge in indexing who could train a small team in this area.', '', 92, '06/04/2011 12:00 am', 'Involvement in training and knowledge transfer in areas within copyediting and beyond editing in terms of book layout is a focus area this year in addition to everyday work.', 0, '', '', '', '', '', 'Submit', 'Submit', '', '', 0, '', '2011-03-30', '2011-03-30');
