(865, 168, '', 72, '30-03-2011/06:37:50', '', '', 69, '09/04/2011 12:00 am', 'A potential team leader. Her good knowledge in MathML helped MHHE in sharing the NIMAS work during the lean period. However, needs to\r\nimprove her communication skills. Needs to focus on improving quality.\r\n', 50, '15/04/2011 04:00 pm', 'Communication skills not upto expectations.', 'N', '', '', 'Submit', 'Submit', 'Submit', '', 60, 'Submit', '2011-03-30', '2011-03-30'),
(866, 1037, '', 96, '30-03-2011/05:53:10', '', '', 98, '07/04/2011 12:00 am', 'Geetha is extremely committed to her projects and towards her client. \r\n\r\nThe record for the current year is that she managed a 700+ paged heavy math project delivered just in 45 days [from I Round to printer], which the client was excited about and they could manage the book published on time. There was great support by all the supporting teams as well on this project -- a perfect team work!!\r\n\r\n1. Overall its very a good performance of you and your team\r\n2. The way you managed with difficult projects like Jazar, Ashford and most of your z-line projects with predominantly a junior team is excellent\r\n3. I have seen you teaching your members is good -- you prepare for it, put things in writing, and try to make it clear & perfect!!\r\n4. The team coordination is good, which you are continuing to be good in this\r\n5. Your care and sincereity to client is really remarkable\r\n6. You communicate well but there is good scope on improving the language - I mean in terms of grammar\r\n7. The record maintenance to be improved -- tracking on productivity\r\n8. Challenges next:\r\na. getting all the members and you trained in WileyML 3G so that there can be is a transition from 2.1 to 3G, it will be smooth\r\nb. getting your members trained on ID pagination\r\n9. FY12, our main focus should be on stabilizing all our processes, tools, templates, thereby bring in simplified worflow and processes, which can result in enhanced efficiency, increased productivity, lesser person dependency ', 0, '', '', '', '', '', 'Submit', 'Submit', '', '', 0, '', '2011-03-30', '2011-03-30'),
(867, 1066, '', 88, '30-03-2011/07:11:42', '', '', 88, '12/04/2011 12:00 am', 'Felt pressurised during the year - lack of timely resources, Felt there was less support,\r\nfeels employees not benefited.\r\n\r\nCustom pub title was challenging, did corrections in PDF.  BSG projects were challenging as well. did NIMAS products.\r\n\r\nWants to improve on handling bigger project.\r\nShould start thinking in mgt perspective. \r\nFrom delivery management to project management\r\n\r\n\r\ncurrent ctc 21K, expecting 30K\r\n\r\n', 0, '', '', '', '', '', 'Submit', 'Submit', '', '', 100, 'Submit', '2011-03-30', '2011-03-30'),
