(875, 995, '', 97, '30-03-2011/06:44:04', '', 'Iam very much interested to learn Indesign Template Training, since i had a working knowledge as a Indesign pagination for example i work for the following titles (Caramani and Ahis). \r\n\r\n', 98, '09/04/2011 12:00 am', '', 100, '16/04/2011 11:00 am', 'Senthil has developed himself from a LaTeX typesetter to a LaTeX template creator. And today he successfully creates templates independently.\r\n\r\nThe next step could be learning InDesign template creation and I am sure in the next few months, he will be good in that too!!\r\n\r\n', '', '', '', 'Submit', 'Save', 'Submit', '', 0, '', '2011-03-30', '2011-03-30'),
(876, 1198, '', 20, '30-03-2011/06:36:48', 'Putting my effort and doing my best in EMS', '', 46, '11/04/2011 11:07 pm', 'Karthink has been showing in good improvement in gaining technical knowledge and showed good interest in understanding the EMS framework. He had shadowing himself with senior associates and got trained to code in a short period of time. He had developed two modules and also took complete ownership in solving issues arised in Project and Program setup. \r\nNeed to show a good learning curve in gaining technical knowledge, planning and communication.', 0, '', '', '', '', '', 'Submit', 'Submit', '', '', 0, '', '2011-03-30', '2011-03-30'),
