(881, 1015, '', 91, '30-03-2011/07:06:22', '', '', 96, '08/04/2011 12:00 am', 'Sasi manages the composition team for the Wiley-UK STMS projects and she is one highest volume holder in the Wiley-Books cluster. Very committed and hardworker, who showed a good development in the last year right from planning and managing her team and projects.\r\n\r\n1. Overall its very a good performance of you and your team\r\n2. The volume you hold is extremely good and one of the highest in our cluster\r\n3. You have improved on your planning -- I see meticulously you do the title planner and I see there are almost no surprises in meeting the deadlines of the projects, which could be result of your planning\r\n4. Good that you even started speaking with the client on the weekly status calls!!\r\n5. The communication on projects with the supporting team or PM has to be more formal and prevent oral confirmations/communications. You have improved on this, still there is a fair scope to improve is my observation\r\n6. It is important that escalation to superior need to be done at the right time and with sufficient clarity/details -- I see improvement on this too but still the gap could be reduced even further\r\n7. Many times, we leave the control on schedule with the PM, can result in last minute rushes, which can endup with issues, as well affecting other projects. This will be balanced if we have a more formal approach\r\n8. An intense focus on details provided by client and language improvement in communication can help in enhancing our quality of our service\r\n9. Challenges for the coming year: getting all the members and you trained in WileyML 3G so that there can be is a transition from 2.1 to 3G, it will be smooth\r\n10. FY12, our main focus should be on stabilizing all our processes, tools, templates, thereby bring in simplified worflow and processes, which can result in enhanced efficiency, increased productivity, less person dependency -- for you to start with documenting the template creation processes\r\n', 0, '', '', '', '', '', 'Submit', 'Submit', '', '', 0, '', '2011-03-30', '2011-03-30'),
