(926, 984, '', 90, '08-04-2011/11:39:47', '', '', 71, '08/04/2011 12:54 am', 'Performance is good. Expecting her to improve in the productivity and quality. Also, she should learn more other than the current work', 50, '16/04/2011 11:00 am', 'Thulasi is very prompt to work and quiet.\r\n\r\nShe does the backed-out word file conversion under the supervision of Nanda, which she does fairly well.\r\n\r\nShe has to develop creating a plan and working towards it. She fails on this at times, which I am sure she will correct this in the coming year.\r\n\r\nThe next learning to her could be the XML conversion (where she has been taught partly) and eBook creation.\r\n\r\nNeed more initiative from her and she can grow.', '', '', '', 'Submit', 'Submit', 'Submit', '', 0, '', '2011-04-08', '2011-04-08'),
(927, 970, '', 56, '09-04-2011/10:45:02', 'Items not applicable to supporting team - Financial and  Employee Engagement under "Customer Related".  Hence did not fill my rating.  This has an implication on the overall rating. Please advise\r\n\r\nGROWTH ORIENTATION:\r\n\r\n1. Created a script for conversion from WileyML2.1 to eBooks for iPad and Mobipocket (.epub and .prc) files; Increase productivity from 60 typeset pages/person/day to 300 pages/person/day; Increased revenue per operator per day from $54.00 to $300.00; Reduced delivery time from 10 to 5 working days after printer files; Consistent quality and reduced complaints from client; Total revenue from eBook creation for this year will be approx. $45,000\r\n\r\n2. To improve production and quality in Journals - \r\na) LaTeX to xml conversion for WIRES journals - to increase production from 25 to 50 pages per day;\r\nb) Wiley US journals - rebuild latex templates to reduce handovers and increase production from 15 to 25 pages per day\r\nc) JPCMS - setup watchfolder for fontcheck, move to production folders, trigger emails to print,\r\ncopyediting;\r\nd) Rep copy pdf and its application file creation for exWiley jnls\r\n\r\n3. Details on materials required for complete training in LaTeX pagination for Books, Journals and MRWs are entered to a spreadsheet "latex-training-Oct2010.xls" which contains 4 sheets: 1) Latex-training which are common to all and specific instructions for 2) Books 3) Journals and 4) MRWs This sheet is available under the folder chgnsm02macdataBooksPTGTraining-documents\r\n\r\n4. Modifications to "WileyPreedit2WileyML"" tool - direct conversion of Wiley Preedited Word to WileyML files - achieved 25% increase in production (based on data, reduced time spent from 90 min to 60 min for 12 pages);\r\n\r\n5. Rectified the issues in Word to LaTeX conversion to reduce time on formatting;\r\n\r\n6. Full support for creation of WileyML3G samples for HE, help with clients demo;\r\n\r\n7. LaTeX to WileyML3G tex4ht template - New tool for conversion from LaTeX to WileyML3G files\r\n\r\nCUSTOMER ORIENTATION:\r\n\r\n1. Created a pdf action to create bleed and crop box for pdfs created in LaTeX; automatic hyphenation of URLs in LaTeX composition; \r\n\r\n2. Creation of Cambridge dictionary for Copyediting team to be used to spell check for titles which needs to follow this style\r\n\r\n3. Updations to all scripts/workflows based on issues from clients - major changes to back-end xml conversion and .epub & .prc scripts\r\n\r\n4. Creation of 2 PS files by automatically linking the online figures from its respective folders using print InDesign files with few validations and one using print figures.  Both the PS files will be saved in respective watchfolders for pdf creation\r\n\r\nORGANIZING & UTILIZATION OF RESOURCES\r\n\r\n.epub & .prc files - During sample creation stage, provided high quality test files done manually (partial) to client for 15,000 pages \r\n\r\nFOCUS AREAS IN 2011-2012: Development of all tools for round-trip composition in LaTeX from WileyML3G files and to deliver digital and online files; To achieve manpower reduction for stages - front-back end xml conversion, eBook conversion; Implementation of round-trip composition in LaTeX from WileyML3G files in Books, Journals & MRWs clusters; \r\n', '1. Exposure to other software developments in other EGs for Knowledge sharing \r\n\r\n2. Would like to attend to trainings related to production to learn new practices in production. \r\n\r\n', 0, '', '', 0, '', '', '', '', '', 'Submit', '', '', '', 0, '', '2011-04-08', '2011-04-09'),
(928, 260, '', 98, '11-04-2011/05:20:41', '1. Achieved the top line target of Creative Art.\r\n2. Achieved top line target of Schools till Q3 while handing over to Rod. Assisted in Q4 also to get closer to the annual top line target.\r\n3. Consolidated the School clusters and improved the EBIDTA from negative to +40% consistently.\r\n4. Won the best business plan award and best operational practices award.\r\n5. Received lot of client appreciations from HMH & Pearson for Schools and many for Creative Art. HMH confidence level has improved to the extent of assigning project to us by pulling from other vendors.\r\n6. Maintained Schools productivity and quality at record levels.\r\n7. Transformed DLF teams as better disciplined and work focused following good ethics.\r\n8. Mentored and developed the project managers on client communication, teleconference and effective team management.\r\n9. Knowledge sharing forum, internal cross functional training and many other initiatives.\r\n10. Motivated and supported Schools to become the overall champions in cultural.\r\n11. Automated, simplified and regularized DSR process, single page tracker and other practices.\r\n12. Initiated and stressed on the need for SAR.', 'New Media, XML conversion and training related to new services LW is planning to venture in.', 89, '21/04/2011 12:00 pm', 'Has the making of a good leader and can be a molded into one. \r\n\r\nNeeds to provide more black n white, concrete indicators of Performance such as much higher growth in revenues and profits. Needs to sell himself to his Peers to clearly come-out as a winner - a first among equals.', 0, '', '', '', '', '', 'Submit', 'Submit', '', '', 0, '', '2011-04-08', '2011-04-11'),
