(940, 22, '', 94, '11-04-2011/08:06:35', 'Successes:\r\n\r\na. The schedule adherence was close to 99%, though had no proper/prior schedules from client on 50% of the projects\r\nb. Given consistent performance -- both in quality and schedule\r\nc. Smooth transition from LaTeX platform to InDesign for TD-Line division of Wiley P&amp;T, as requested by the client\r\nd. Getting the Wiley-HE team prepared on transition from WileyML2.1 to WileyML3G\r\ne. Making at least about 10 LaTeX compositors trained in InDesign pagination \r\nf. Started successfully new business with clients like Wiley-Canada, Jones &amp; Bartlett, and OUP-India\r\ng. Started successfully with the eBook production and have managed about 90K pages (from app. 170+ projects)\r\n\r\nFailures:\r\n\r\na. Bartholomew -- the printer PDF had the ligatures missing on Chapters 4 and 7. We had to compensate $456 to client on this title for this error in the PDF files.\r\nb. Attrition rate was closer to 30% -- The paginators were multi-skilled (well versed in XML conversion, Pagination both in LaTeX and InDesign) and their market value is higher, which proved to be the major reason for the attrition. \r\n\r\nGeneral statistics for Apr 10-Mar 11:\r\n\r\na. No of projects handled -- 500+\r\nb. No of pages handled -- App. 1.2+ Lakhs (considered only the composition projects)\r\nc. Total invoicing made -- US$1250K as against the target of US$1506K\r\nd. EBITA Target &amp; Actual -- 16%\r\n\r\nChallenges for the coming year:\r\n\r\na) Be Platform Agnostic: Should be platform independent -- should have the capability of going into LaTeX / InDesign / Word, based on the design and text of the project. Platform dependency shouldn&#039;t be a constraint for efficient handling of any project.\r\n\r\nTowards the above goal, we need to have tools developed for XML-first workflow and the post-processing ready, in all platforms.\r\n\r\nb) Transition from WileyML 2.1 to WileyML 3G: Getting all the members trained on WileyML3G will be an urgent task to do, as this transition can be expected in next 3 months or earlier. Planning to conduct training to the team in batches starting from \r\nApr. 2011. \r\n\r\nc) &#039;Single &amp; Simple&#039; Worflow: We need to have a single workflow. Ie., normalize any type of input to one common standard format and get the desired files  from that standard format. Today, we have multiple workflows and multiple conversion tools based on the type of inputs. This makes tougher for members to be trained on and to become an expert handling them.\r\n\r\nd) Efficient Tools: All the existing tools have to be revamped for better efficiency and accuracy. \r\n\r\ne) Attrition Rate: If we have a simple and efficient workflow in place, this should help us in arresting the attrition rate. Also it won&#039;t be a big task in handling this, as the workflow and processes would be simple to get the new members trained in and deployed easily into live work.\r\n\r\nf) Growth: Bring in growth to the company and all the members by means of increased business through an increased efficiency.\r\n', 'WileyML 3G training to the team, which could be the priority for the coming year.\r\n\r\n', 0, '', '', 0, '', '', '', '', '', 'Submit', '', '', '', 0, '', '2011-04-11', '2011-04-11'),
