(942, 1190, '', 93, '11-04-2011/11:44:22', '\r\nNEW PRODUCTS:\r\n\r\n1.	Have rolled out OPS WILEY successfully on self merit and satisfied all stake holders. \r\nThis is a HA application.\r\n\r\n2.	Have provided most advantageous solution OPSInternal to LW to cut down the cost, resource and time on self merit. Using self caliber, software installation, configuration and application porting is achieved within 2 holidays from windows to LINUX platform.\r\nThis is a HA application.\r\n\r\n3.	Rolled out MRWs Proofing system in DEC, 2011 on self merit. This is serving the client and production effectively. This is a HA application.\r\n\r\n4.	Have integrated almost all production tools in CEPRO web application which enabled the ORG to scale up in production, schedule and quality. This is a HA application.\r\n\r\n5.	Have developed and demonstrated SAR (System For Archive And Retrieval) several times to the client successfully. This is well known to top management.\r\n\r\n6.	HRMS &amp; RRF,  new products has been rolled out in JAN, 2011 for HR which is well serving the needs of HR operations.\r\n\r\n7.	NEW SWIPE SERVER integration was achieved on high demand by self merit in the benefit of ORG and HR operations.\r\n\r\n8.	 Have contributed LR library and Soft Proofing modules for IPF and accomplishing the change requests as and when required.\r\n\r\n9.	Have contributed by allotting Scriptorium team resources to almost all the applications or teams in the ORG.\r\n\r\n24X7 SUPPORT &amp; MAINTENANCE OF PRODUCTS:\r\n\r\n1.	eProof Wiley is developed by me and endlessly serving Madison, LW and client. \r\nThis is a HA application.\r\n\r\n2.	 Scriptorium an ERP, self developed and well managed to meet ORG requirements as and when most needed. So capable and well designed application which is endlessly serving all departments of the ORG from more than a decade.\r\n\r\n', '', 0, '', '', 0, '', '', '', '', '', 'Submit', '', '', '', 0, '', '2011-04-11', '2011-04-11'),
