(944, 36, '', 97, '11-04-2011/08:17:57', 'Did not have a clear mandated KRA/KPI for the year. Set few targets of my own and achived the same\r\n- SLA for problem resolution to bring down to less than 1.5 hrs from 2.5 hrs at the beginning of the year - Achieved\r\n- Introduce VLANs on the network - Achived\r\n- Implement DHCP based network - Achieved\r\n- 24 X 7 availability of support executives - Achieved\r\n- Strengthen backup process to minimize data loss - Achieved (Zero data loss reported in the year)\r\n- Visibility to data backup process to end users - Achieved\r\n- Visibility to daily FTP and Printing status first thing in the morning to Cl/TL - Achieved\r\n- Weekly bay/Seat usage monitoring/reporting - Achieved\r\n- Minimize server unplanned downtime - Achieved total server downtime in the year was approximately 5 hours as compared to 50+ hours in year 2009-10\r\n- Successfully setup IPF Customer support group\r\n- As a member of process group Actively participated in corporate initiative CMMI certification  \r\n- Participated PMI training\r\n- Prepared IT budget for FY2011-12\r\n\r\n\r\nAs organizational needs\r\n- Whenever a new technology is considered\r\n- Should be allowed to attend seminars, which not only helps in making technology up-to-date also \r\ncreates the platform to build networking with SMEs\r\n', '- As per organizational need\r\n- Relevant training (if any) on new technological implementations proposed', 0, '', '', 0, '', '', '', '', '', 'Submit', '', '', '', 0, '', '2011-04-11', '2011-04-11'),
