(947, 1227, '', 88, '11-04-2011/11:17:05', 'Once I give the schedule/target to the stack holders. I never fall. surely I will deliver it ahead the schedule.\r\n\r\nNow i have taken all the conversion part in LW. I am working on that. implementation of this is my next target and this is one type of growth. I thanks to you, to give this opportunities to me', '', 78, '19/04/2011 04:00 pm', '', 0, '', '', '', '', '', 'Submit', 'Submit', '', '', 0, '', '2011-04-11', '2011-04-11'),
(948, 1197, '', 81, '11-04-2011/11:39:17', 'Top-line Target: I have met all the deadlines set within the project but need to ensure the deadline set at go live are also met on time. \r\nMargin Target: I have been able to meet all deadlines set within the project with few resources contributing from the development front.\r\nCustomer Orientation:  I have been keen in responding to customer mails and people also felt comfortable in interacting with me. Have always shown great respect towards any feedback given by the client. I am available when in need at any time.\r\nEmployee Engagement: I have involved in all recruitment process and had selected good experienced and freshers for the overall benefit of the organization.\r\nCommunication: I have been very prompt in responding any customer mails.  Have always maintained mail communications for allocating task, updating the status and outlook for initiating meeting request.  I have also tracked the task using outlook feature. \r\nResource Utilization: EMS has been built to this level having just 3 senior resources and two juniors. The resources are utilized based on the skill and proper guidance have been given for improving their performance.\r\nTeam Relationship: I have good relationship with team and keep them posted in all top management updates.  Continuous support, frequent status meeting and mail communication have improved my team to be more professional. I often have one on one with the team.\r\nTemperament: I have missed to control my emotions when people give different updates to each person. At the same time I did not get convinced for any improper communication.\r\nGrowth Orientation: I have gained good experience in managing and delivering EMS to good extent and also trained my team to deliver task on time by giving continuous guidance.', '', 78, '19/04/2011 06:00 pm', '', 0, '', '', '', '', '', 'Submit', 'Submit', '', '', 0, '', '2011-04-11', '2011-04-11'),
(949, 83, '', 53, '12-04-2011/09:23:49', 'Topline and Bottomline targets do not apply in this case.\r\n\r\nKey Contribution Areas:\r\n\r\nA. Ensuring a constant delivery to HMH on the School DSR.\r\n\r\nB. Successful utilization and redeployment of personnel as a Resource pool head\r\n\r\nKey successes of RP:\r\n----------------------------------------------\r\n1. Placement of TL for the night support function of IPF for the Support team.\r\n2. Placement of support executive \r\n3. Placement of trained InDesign resources within the JW-US Cluster to start production of their new client OUP(india) projects\r\n4. Placement to the NIMAS team to ensure meeting critical schedules\r\n5. PLacement of a TL within the NIMAS Cluster. \r\n6. Replacement supply for PHE, Journals, New media helped retain talent within the organization. \r\n7. Creation of the &#039;across the company&#039; database for the System of Archiving and Retrieval(SAR).\r\n\r\n-----------------------------------------------\r\n\r\nC. Providing visibility to the management thru&#039; the OPs Metrics and following thru&#039; on committments made during the review meetings.\r\n\r\nD. Constant follow up on topline during the ending of H1 and the year-end, ensuring meeting committed numbers.\r\n\r\nE. Effective participation in the School DSR and trouble shooting issues alongwith the team. Early warnings on potential issues.\r\n\r\nF.  Effective implementation of the Cap sheet formats in the School and HE EG.\r\n\r\nG. Team member in the CMMI Process Group and EMS implementation team.', '', 88, '16/04/2011 03:36 pm', 'Done well in driving up the revenues and contribution of different clusters during the year, and supporting the schools group. needs to bring more drive and place more importance on org.initiatives like Archives, Capacity sheets etc.', 0, '', '', '', '', '', 'Submit', 'Submit', '', '', 0, '', '2011-04-12', '2011-04-12'),
(950, 87, '', 65, '12-04-2011/03:54:54', 'Achievements during the year 2010-11\r\n\r\nHelped Journals cluster to improve their performance by offering the QM and QA support. Daily audits are conducted to enforce process discipline.\r\n\r\nProgress made in CMMI preparation for Laserwords. Expect to get the approval for documentation by KPMG on 18th April and the target date for CMMI certification is July 2011', 'Training a Master Black Belt by any reputed organization.\r\n\r\nTraining as a audit team member for CMMI.', 80, '21/04/2011 01:00 pm', 'Growth needs to be based on black &amp; white growth %age shown in different clusters', 0, '', '', '', '', '', 'Submit', 'Submit', '', '', 0, '', '2011-04-12', '2011-04-12'),
(951, 31, '', 100, '12-04-2011/05:38:56', 'Have done well in the following areas :\r\n\r\n1. Expense planning\r\n2. Adherence to committed budget\r\n3. Shown savings ( for example 31 lakhs in Electricity alone )\r\n4. Handled admin / facilities with minimum team strength \r\n5. Coordinated and completed the projects given by management\r\n6. Coordinated 7500 trips in this year in staff transportation with nil accident report\r\n7. Staff welfare measures implementation like conducting medical camps\r\n8. Coordinated during client visits \r\n9. With medium security ensured nil complaints of thefts\r\n10. Proactively contributed during annual day celebrations\r\n11. Have positioned as a reliable partner in all company initiatives\r\n12. Developed self to an extent so as to hold even more responsible positions', '', 88, '19/04/2011 06:44 pm', 'Done a phenomenal job in saving Rs 60 lakhs plus from Admin Budget. \r\n\r\nNeeds to work on educating employees on different admin initiatives.\r\n\r\nNeeds to work on formalizing inventory management / purchasing functions. Take purchasing away from Finance.', 0, '', '', '', '', '', 'Submit', 'Submit', '', '', 0, '', '2011-04-12', '2011-04-12'),
(952, 94, '', 79, '16-04-2011/10:47:39', 'TPS major initiatives \r\n1.	SAR  Design and functionalities completely changed. NGSP and Kendall Hunt are the two prospective clients for this project. Team would like to thank Krishna for all his support and technical inputs.\r\n2.	InDesign Compare tool  CS4 version  Ready to release, can be integrated with EMS. Once this tool is tested in our production floor, we can take this to Adobe  there is no InDesign compare tool available in the market.\r\n3.	 Design prototype creation tool  Will be released by May end. Can be showcased to Publishers. Useful tool for designers.\r\n4.	Pearson Custompub tool  TPS developed two modules. Though we will not be paid for this tool, certainly our relationship will better with Pearson Central Pub.\r\n5.	Design and templates for all IPF projects.\r\n\r\n\r\n2011 Goal:\r\n\r\nReview of Nimas and NewMedia clusters current process and procedures and make necessary changes to improve their productivity and quality.\r\n\r\nMHHE - Provide solution for their XML export process. This will save atleast  20 resources per month at FAC II', '', 85, '16/04/2011 01:37 pm', 'Good contribution to revenues... need  to initiate BPR for company-wide workflows, to be judged on process efficiency performance against industry benchmarks..\r\n\r\nNeed more focus on deadlines and faster completion of different initiatives..', 0, '', '', '', '', '', 'Submit', 'Submit', '', '', 0, '', '2011-04-16', '2011-04-16');
