(954, 442, '', 89, '16-04-2011/02:03:42', 'INITIATIVES:\r\n\r\n1. Initiated  mail campaign and brought in new business for Facility I &amp; II\r\n2. We have got 2 new services from existing client (ePub from NYR and InDesign comp work from AARDVARK Group) and 1 new client (Melville Publishing - Keyboarding &amp; InDesign comp work). Couple of prospective clients are in the pipeline\r\n3. Organized Quark and InDesign training. Live work started with a 10 member team for Pearson and Kendall Hunt\r\n4. English speaking course for TLs	\r\n\r\n\r\n', '1. People Management training for TLs\r\n2. A dedicated TPS/R&amp;D team \r\n', 84, '19/04/2011 11:30 am', 'Demonstrates people management skills and has the making of a good leader..\r\n\r\nNeeds to focus on core Production processes  - PPC, Workflow Automation, Process  setup &amp; Re-engineering etc...\r\n\r\nNeeds to develop Profit center Management skills..\r\n\r\nNeeds to develop Entrepreneurial skills focused on setting-up new service-lines / new businesses.', 0, '', '', '', '', '', 'Submit', 'Submit', '', '', 0, '', '2011-04-16', '2011-04-16'),
